import axios from 'axios';
import BattleShipGrid from '../BattleShipGrid.js'

export default class Index extends React.Component {


  constructor(props) {
    super(props)
    this.state = {
      board: {}
    }
  }

  componentDidMount(){
    fetch('http://localhost:3001/mainThread/createboard')
    .then(res => res.json())
    .then(data => {
      this.setState({ board: data })
    });
  }


  render() {
